import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

function Content() {
    return (
        <>
        <App />
        <p>Test</p>
        </>
    )
}

function Header() {
    return (
        <>
        <ul>
            <li>1</li>
            <li>2</li>
        </ul>
        </>
    )
}

function Introduction() {
    return (
        <>
            <h1></h1>
            <p></p>
            <p></p>
        </>
    )
}

ReactDOM.render(<Content />, document.getElementById('root'));
